import React, { Component } from "react";
import { connect } from "react-redux";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import AccountCircle from "@material-ui/icons/AccountCircle";
import HttpsIcon from "@material-ui/icons/Https";
import Form from "../common/Form";

const loginContent = [
  {
    id: "0",
    icon: <AccountCircle />,
    text: <TextField id="login-username" label="Username" error={false} />,
  },
  {
    id: "1",
    icon: <HttpsIcon />,
    text: <TextField id="login-password" label="Password" type="password" />,
  },
];
const loginButton = <Button variant="contained">Login</Button>;

class Login extends Component {
  render() {
    return (
      <Form title="Login" formContent={loginContent} button={loginButton} />
    );
  }
}

const mapStateToProps = (state) => {
  console.log(state.todoState);
  return {
    todos: state.todoState,
  };
};

export default connect(mapStateToProps)(Login);
